  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Seney National
  Wildlife Refuge outlines Refuge accomplishments from May through July of 1941. The
  report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, and fish- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  and collections and receipts. Resource management is outlined; topics include timber
  removal. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses.\",\n\t\"owner_org\":
